	@Override
	public String handle(String message){

		long startTime = System.nanoTime();
		GenericMapper gm = null;
		JsonMessage jm = JsonMessage.createJsonMessage(message);
		System.out.println(jm);
		JsonObject payload = jm.getPayloadValues();

		try {
			if(!(jm.getServiceType().equals(Servicetypes.WORKSPACECONFIGURATION) && jm.getType().equals(Types.POST))) jm.setPayloadValues(new JsonObject());


			String type = jm.getType().name().toLowerCase();
			try {
				switch(jm.getFormat())
				{
				case "tcsxml":
					gm = new JSONMapper();
					jm.getPayloadValues().add("MAPRESULT", gm.generate(payload, type, jm.getFormat()));
					break;
				case "tcsjson":
					gm = new JSONMapper();
					jm.getPayloadValues().add("MAPRESULT", gm.generate(payload, type, jm.getFormat()));
					break;
				case "xml":
					gm = new XMLMapper();
					jm.getPayloadValues().add("MAPRESULT", gm.generate(payload, type, jm.getFormat()));
					break;
				case "json":
					gm = new JSONMapper();
					jm.getPayloadValues().add("MAPRESULT", gm.generate(payload, type, jm.getFormat()));
					break;
				case "jsondetail":
					gm = new JSONMapperDetail();
					jm.getPayloadValues().add("MAPRESULT", gm.generate(payload, type, jm.getType().name()));
					break;
				}
			} catch (FactoryConfigurationError e) {
				e.printStackTrace();
			}

			String resultKey = null;
			for(Entry<String,JsonElement> entry : jm.getPayloadValues().entrySet()) {
				System.out.println(entry.getKey());
				if(entry.getKey().contains("ResultSet_")){
					resultKey = entry.getKey();
				}
			}
			if(resultKey!=null) jm.getPayloadValues().remove(resultKey);

			if(jm.getServiceType().equals(Servicetypes.WORKSPACECONFIGURATION)) super.setSendQueue("ToWorkspace");
			else if(jm.getResponseNode().equals("ToScheduler")) super.setSendQueue("ToScheduler");
			else super.setSendQueue("ToWebApi");

			long endTime = System.nanoTime();
			System.out.println("Duration execution: seconds "+(endTime - startTime)/ 1000000000.0);
			System.out.println(JsonMessage.getJson(jm));
		}catch(Exception e) {
			e.printStackTrace();
		}
		return JsonMessage.getJson(jm);
	}

